import React, { useEffect, useState } from 'react';

type Data = {
  [x: string]: any;
  date?: String,
  url?: String,
  title?: String
}

function Favorites() {
  const [favorites, setFavoirtes] = useState<Data>({});
  useEffect(() => {
    const fetchFavoirtes = async () => {
      const fav = await fetch('http://localhost:5000/favorites');
      const FavData = await fav.json();
      setFavoirtes(FavData);
      // console.log(favorites);
    };
    fetchFavoirtes();
  }, []);

  if (favorites) {
    console.log(favorites);
  }
  // const { date } = favorites;

  return (
    <div>
      {favorites.map(({
        date, url, title,
      }: Data) => (
        <p>{date}</p>
      ))}
    </div>
  );
}

export default Favorites;
